import './App.css';
import Info from './components/Info'
import About from './components/About'
import Interests from './components/Interests'
import Footer from './components/Footer'

function App() {
  return (
    <div className="App">
      <div className='main'>
        <Info />
        <About />
        <Interests />
      </div>
      <div>
        <Footer />

      </div>
    </div>
  );
}

export default App;
